        magnificationModal += '<table class="fp_magnification-table"> <tr><td>40-44</td><td> +1.00 </td></tr> <tr><td>45-49</td><td>  +1.00 to +1.50 </td></tr> <tr><td>50-54</td><td> +1.50 to +2.00 </td></tr> <tr><td>55-59</td><td> +2.00 to +2.50 </td></tr> <tr><td>60+</td><td> +2.50 </td></tr> </table>';
        magnificationModal += '<span class="fp_back"><svg width="9" height="13" viewBox="0 0 9 13" fill="none" xmlns="http://www.w3.org/2000/svg"><path d="M8 12L0.999999 6.5L8 1" stroke="#101010"/></svg> <span>Back</span> </span> </div></div></div></div>'
