    popupEvents: function() {
        $(document).on('click', '.lens__header .fp_notsure', function(e) {
            console.log('fdfdffdfdfddf')
            e.preventDefault();
            $('.fp_modal_container--first').show();
        })

        $('.fp_close').on('click', function() {
            $('.fp_modal_container').hide();
        });

        $('.determine-by-age').on('click', function() {
            $('.fp_modal_container--first').hide();
            $('.fp_modal_container--second').show();
        })

        $('.fp_back').on('click', function() {
            $('.fp_modal_container--second').hide();
            $('.fp_modal_container--first').show();
        })


        $('.fp_modal_klaviyo-bis-close').on('click', function() {
            $('.fp_modal_container').hide();
        });

        $('.fp_container').on('click', function(e) {
            e.stopPropagation();
        });
    },
    runLocalFunctions: function() {
        $('.secondary-images a').on('click', function(e) {
            e.preventDefault();

            var that = $(this),
                image_link = that.data('image'),
                main_image = $('.product-main-image img');

            $(main_image).attr('src', image_link);
            $('.popup-image').attr('href', image_link);
        });



    },
